" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Primary biliary cirrhosis in a 35-year-old woman (high power, Masson trichrome)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 284px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Epithelial cells in the lower half of the bile duct are infiltrated with lymphocytes and have been sloughed.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Marshall M. Kaplan, MD.",
"    </div>",
