"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H2\">",
"      ANGIOTENSIN CONVERTING ENZYME INHIBITORS",
"     </a>",
"    </li>",
"    <li class=\"bulletItem\">",
