var title_f13_43_14012="FDA safe use guidelines";
var content_f13_43_14012=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F77651&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F77651&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    FDA guidelines for safe use of contact lenses",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        &bull; Always wash your hands before handling contact lenses to reduce the chance of getting an infection.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Remove the lenses immediately and consult your eye care professional if your eyes become red, irritated, or your vision changes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Always follow the directions of your eye care professional and all labeling instruction for proper use of contact lenses and lens care products.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Use contact lens products and solutions recommended by your eye care professional.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Do not use contact lens solutions that have gone beyond the expiration or discard date.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Rub and rinse your contact lenses as directed by your eye care professional.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Clean and disinfect your lenses properly following all labeling instructions provided with your lens care products.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Do not \"top-off\" the solutions in your case. Always discard all of the left over contact lens solution after each use. Never reuse any lens solution.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Never use non-sterile water (distilled water, tap water or any homemade saline solution). Exposure of contact lenses to water has been associated with Acanthamoeba keratitis, a corneal infection that is resistant to treatment and cure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Do not put your lenses in your mouth to wet them. Saliva is not a sterile solution.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Clean, rinse and air-dry your lens case each time lenses are removed. You may want to flip over your lens case while air drying so excess solution may drain out of the case. Contact lens cases can be a source of bacterial growth.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Replace your contact lens storage case every 3 to 6 months.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Do not transfer contact lens solutions into smaller travel size containers. This can affect the sterility of the solution which can lead to an eye infection. Transferring solutions into smaller size containers may also leave consumers open to accidentally using a solution not intended for the eyes.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: US Food and Drug Administration, www.fda.gov/cdrh/contactlenses/lenslist.html.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
