var title_f13_43_14013="BTS CAP guidelines";
var content_f13_43_14013=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F74382&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F74382&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    British Thoracic Society guidelines: Initial empirical treatment regimens for community-acquired pneumonia (CAP) in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Pneumonia severity (based on clinical judgement supported by CURB65 severity score)",
"      </td>",
"      <td class=\"subtitle1\">",
"       Treatment site",
"      </td>",
"      <td class=\"subtitle1\">",
"       Preferred treatment",
"      </td>",
"      <td class=\"subtitle1\">",
"       Alternative treatment",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Low severity",
"       </strong>",
"       (eg, CURB65 = 0-1",
"       <em>",
"        or",
"       </em>",
"       CRB65 score = 0, &lt;3 percent mortality)",
"      </td>",
"      <td>",
"       Home",
"      </td>",
"      <td>",
"       Amoxicillin 500 mg orally three times daily",
"      </td>",
"      <td>",
"       Doxycycline 200 mg loading dose then 100 mg orally once daily",
"       <em>",
"        or",
"       </em>",
"       clarithromycin 500 mg orally twice daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Low severity",
"       </strong>",
"       (eg, CURB65 = 0-1, &lt;3 percent mortality) but admission indicated for reasons other than pneumonia severity (eg, social reasons/unstable comorbid illness)",
"      </td>",
"      <td>",
"       Hospital",
"      </td>",
"      <td>",
"       <p>",
"        Amoxicillin 500 mg orally three times daily",
"       </p>",
"       <p>",
"        If oral administration not possible: amoxicillin 500 mg IV three times daily*",
"       </p>",
"      </td>",
"      <td>",
"       Doxycycline 200 mg loading dose then 100 mg orally once daily",
"       <em>",
"        or",
"       </em>",
"       clarithromycin 500 mg orally twice daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Moderate severity",
"       </strong>",
"       (eg, CURB65 = 2, 9 percent mortality)",
"      </td>",
"      <td>",
"       Hospital",
"      </td>",
"      <td>",
"       <p>",
"        Amoxicillin 500 mg to 1 gram orally three times daily",
"        <em>",
"         plus",
"        </em>",
"        clarithromycin 500 mg orally twice daily",
"       </p>",
"       <p>",
"        If oral administration not possible: amoxicillin 500 mg IV three times daily*",
"        <em>",
"         or",
"        </em>",
"        benzylpenicillin (penicillin G) 1.2 grams IV four times daily",
"        <em>",
"         plus",
"        </em>",
"        clarithromycin 500 mg IV twice daily*",
"       </p>",
"      </td>",
"      <td>",
"       Doxycycine 200 mg loading dose then 100 mg orally",
"       <em>",
"        or",
"       </em>",
"       levofloxacin 500 mg orally once daily",
"       <em>",
"        or",
"       </em>",
"       moxifloxacin 400 mg orally once daily&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        High severity",
"       </strong>",
"       (eg, CURB65 = 3-5, 15-40 percent mortality)",
"      </td>",
"      <td>",
"       Hospital (consider critical care review)",
"      </td>",
"      <td>",
"       <p>",
"        <strong>",
"         Antibiotics given as soon as possible",
"        </strong>",
"       </p>",
"       <p>",
"        Co-amoxiclav (amoxicillin-clavulanate potassium) 1.2 grams IV three times daily*",
"        <em>",
"         plus",
"        </em>",
"        clarithromycin 500 mg IV twice daily*",
"       </p>",
"       <p>",
"        (If Legionella strongly suspected, consider adding levofloxacin&Delta;)",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Benzylpenicillin (penicillin G) 1.2 grams IV four times daily",
"        <em>",
"         plus",
"        </em>",
"        either levofloxacin 500 mg IV twice daily",
"        <em>",
"         or",
"        </em>",
"        ciprofloxacin 400 mg IV twice daily",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Cefuroxime 1.5 grams IV three times daily",
"        <em>",
"         or",
"        </em>",
"        cefotaxime 1 gram IV three times daily",
"        <em>",
"         or",
"        </em>",
"        ceftriaxone 2 grams IV once daily,",
"        <em>",
"         plus",
"        </em>",
"        clarithromycin 500 mg IV twice daily*",
"       </p>",
"       <p>",
"        (If Legionella strongly suspected, consider adding levofloxacin&Delta;)",
"       </p>",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    This table provides the 2009 guideline recommendations of the British Thoracic Society (BTS) for reference purposes. Please see the UpToDate text for information about choosing between the different guidelines and about the preferred doses and durations of the individual antibiotics.",
"    <div class=\"footnotes\">",
"     IV: intravenous.",
"     <br>",
"      * Intravenous preparation not available in the United States.",
"      <br>",
"       &bull; Following reports of an increased risk of adverse hepatic reactions associated with oral moxifloxacin, in October 2008 the European Medicines Agency (EMEA) recommended that moxifloxacin \"should be used only when it is considered inappropriate to use antibacterial agents that are commonly recommended for the initial treatment of this infection\".",
"       <br>",
"        &Delta; Caution: Risk of QT prolongation with macrolide-quinolone combination.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Lim WS, Baudouin SV, George RC, et al. BTS guidelines for the management of community acquired pneumonia in adults: update 2009. Thorax 2009; 64 Suppl 3:iii1. Copyright &copy; 2009 BMJ Publishing Group Ltd.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
